// first "next page" button
cy.get('button[aria-label="Go to next page"]').first().click({
  force: true
});
cy.get('table tbody tr').should('exist');

// second "next page" button
cy.get('button[aria-label="Go to next page"]').eq(1).click({
  force: true
});
cy.get('table tbody tr').should('exist');

cy.get('button[aria-label="Rows per page"]').first().click({
  force: true
});
// Wait for listbox and select "50"
cy.get('div[role="listbox"]').should('be.visible').contains('50').click({
  force: true
});
// Assert rows are <= 50
cy.get('table tbody tr').its('length').should('be.lte', 50);

cy.get('table tbody tr:first-child').within(() => {
  cy.contains('Delete').click({
    force: true
  });
});
cy.contains('Confirm Delete').should('be.visible');

cy.get('input[placeholder="Criteria"]').clear();
cy.contains('button', 'Search').click();
cy.get('table tbody tr').should('exist'); // still shows results

cy.contains('button', 'Filters').click({
  force: true
});
cy.get('div[role="dialog"][data-state="open"]').should('exist');
cy.get('div[role="dialog"] button[role="combobox"]').eq(2).click({
  force: true
});
cy.get('div[role="dialog"] li').contains('2').click({
  force: true
});
cy.get('input[placeholder="Start Date"]').type('3000-01-01');
cy.get('input[placeholder="End Date"]').type('3000-12-31');
cy.contains('button', 'Done').click();
